function TableBody(props) {
    return (
      <tbody>
          {props.data.map((i) => (
        <tr>
            <td>{i.year}</td>
            <td>{i.savingsEndOfYear}</td>
            <td>{i.yearlyInterest}</td>
            <td>{i.savingsEndOfYear - props.initInvestment - i.yearlyContribution * i.year}</td>
            <td>{i.year}</td>
        </tr>
          ))}
      </tbody>
    );
  }

  export default TableBody;
